const App = () => {
  return (
    <div className="logs">
      <div className="item">
        <div className="date">
          <div className="month">4</div>
          <div className="day">20</div>
        </div>
        <div className="desc">学习书法</div>
        <div className="time">55分钟</div>
      </div>
    </div>
  );
};
export default App;
